(function(){dust.register("lan-config-static",body_0);function body_0(chk,ctx){return chk.write("<div class=\"itemborder\"><button title=\"Add IP Range\" class=\"btn btn-primary pull-right addStaticIP\" id=\"addStaticIP\">Add Static IP</button><div id=\"lan-range-view\"><table id=\"lan-static-ip\"><tr><td><label class=\"control-label\" for=\"inputHost\">Network Host</label></td><td><input type=\"text\" id=\"inputHost\" class=\"input-medium\"  placeholder=\"xxx.xxx.xxx.xxx\" disabled value=\"").reference(ctx.get("networkhost"),ctx,"h").write("\"></td></tr><tr><td><label class=\"control-label\" for=\"inputNetmask\">Netmask</label></td><td><input type=\"text\" id=\"inputNetmask\"  class=\"input-medium\" placeholder=\"xxx.xxx.xxx.xxx\" disabled value=\"").reference(ctx.get("subnetmask"),ctx,"h").write("\"></td></tr><tr><td><label class=\"control-label\" for=\"inputGateway\">Gateway</label></td><td><input type=\"text\" id=\"inputGateway\"  class=\"input-medium\" placeholder=\"xxx.xxx.xxx.xxx\" disabled value=\"").reference(ctx.get("gateway"),ctx,"h").write("\"></td></tr><tr><td><label class=\"control-label\" for=\"inputNetmask\">Share VPN</label></td><td><input type=\"checkbox\" id=\"inputShareVPN\" disabled></td></tr><tr><td colspan=\"2\"><button title=\"Change IP address\" class=\"btn btn-primary pull-left editStaticIP\">Edit</button></td></tr></table></div></div>");}return body_0;})();